  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The vendor payment dataset contains payments
  made by state agencies and institutions of higher education that are processed through
  the Office of Management and Enterprise Services. These payments reflect disbursements
  from a state fund for the purchase of goods received, services performed, reimbursements,
  and payments to other governments. Travel reimbursements include the ZIP Code of
  the State Capitol and not the individualu2019s address. For security and privacy
  reasons, payments related to u201cconfidential mattersu201d are included in the
  dataset; however, the payee name is replaced with u201cProtected Informationu201d
  and the address is changed to the State Capitol address. Also, some state agencies
  are authorized to make payments outside of the Office of Management and Enterprise
  Services from certain authorized funds. In these cases, the agency reports only
  the total amount of the expenditures to the Office of Management and Enterprise
  Services but does not report the detailed vendor payment information. Therefore,
  these payment details are not included in the dataset.</p>\",\n\t\"license_title\":
